            img:"/images/iyed.png",
            position:"étudiant 2ème année BI FSEGT",
            phone:"",
              email:"iyed.grr@gmail.com",
            facebook:<a href="https://www.facebook.com/iyedGr">https://www.facebook.com/iyedGr</a>
        }
    ]

//emchi el info w koul object elli entre koul {} men info sammih member w naffadh aalih al eti:
const members = info.map(function (member){              
    return 
       <TeamMember 
           img={member.img}
           name={member.Name}
           position={member.position}
           phone={member.phone}
           email={member.email}
           facebook={member.facebook}
           
           
           
           />



        });



    return (
        <div className="row">
            {members}
        </div>    
    )
}

export default Team;
